import { Routes, Route, useLocation } from 'react-router-dom';
import { useEffect } from 'react';  
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import PropertyList from './pages/PropertyList';
import PropertyDetail from './pages/PropertyDetail';
import PropertiesAvailable from './pages/PropertiesAvailable';
import Login from './pages/Login';
import Register from './pages/Register';
import GuestProperties from './pages/GuestProperties';
import AdminDashboard from './pages/AdminDashboard';
import PendingApprovals from './pages/PendingApprovals';
import LandlordApplicationDetail from './pages/LandlordApplicationDetail';
import LandlordDashboard from './pages/LandlordDashboard';
import ManageProperties from './pages/ManageProperties';
import AddProperty from './pages/AddProperty';
import EditProperty from './pages/EditProperty';
import PropertyProposals from './pages/PropertyProposals';
import TenantDashboard from './pages/TenantDashboard';
import SavedPosts from './pages/SavedPosts';
import Messages from './pages/Messages';
import RecentApplications from './components/RecentApplications';
import Contact from './pages/contact';
import AutoRefresh from './components/AutoRefreshPage';

function App() {
  const location = useLocation();
  const hideNavbarFooter = location.pathname === '/login' || location.pathname === '/register';

  useEffect(() => {
    window.location.reload(); 
  }, [location.pathname]); 

  return (
    <AuthProvider>
      <div className="app">
        {!hideNavbarFooter && <Navbar />}
        
        <main className="main-content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/contact" element={<Contact />} /> 
            <Route path="/properties" element={<PropertyList />} />
            <Route path="/properties/available" element={<PropertiesAvailable />} />
            <Route path="/properties/:id" element={<PropertyDetail />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/guest/properties" element={<GuestProperties />} />

            <Route path="/admin/dashboard" element={<AdminDashboard />} />
            <Route path="/admin/pending-approvals" element={<PendingApprovals />} />
            <Route path="/admin/landlord-applications/:id" element={<LandlordApplicationDetail />} />

            <Route path="/landlord/dashboard" element={<LandlordDashboard />} />
            <Route path="/landlord/properties" element={<ManageProperties />} />
            <Route path="/landlord/properties/new" element={<AddProperty />} />
            <Route path="/landlord/properties/:id/edit" element={<EditProperty />} />
            <Route path="/landlord/properties/:id/proposals" element={<PropertyProposals />} />

            <Route path="/tenant/dashboard" element={<TenantDashboard />} />
            <Route path="/saved-posts" element={<SavedPosts />} />
            <Route path="/applications" element={<RecentApplications />} />

            <Route path="/messages" element={<Messages />} />

            <Route path="*" element={<div>404 - Page Not Found</div>} />
          </Routes>
        </main>

        {!hideNavbarFooter && <Footer />}
      </div>
    </AuthProvider>
  );
}

export default App;
